import { HttpClient } from '@angular/common/http';
import { Inject, Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { IFuncionario } from './funcionario';

@Injectable({
  providedIn: 'root'
})
export class FuncionarioService {
  private apiURL = "http://localhost:44466/api/Funcionarios"; // Corrija a URL de acordo com a sua configuração
  constructor(private http: HttpClient) { }

  getFuncionarios(): Observable<IFuncionario[]> {
    return this.http.get<IFuncionario[]>(this.apiURL);
  }
}
